        fetch('https://api.flickr.com/services/rest/?method=flickr.photos.getRecent&api_key=d492cd9121299f306c4ebf586be48216&format=json&extras=owner_name,url_s,url_m,url_l,description,tags&nojsoncallback=1')
        .then(response=>response.json())
        .then(data=>setFlickrData(data));
 }, []);
if(!flickrData){
    return <div>Waiting for data</div>
}
return (
    <div>
        {flickrData}
    </div>
)
}
